    month = as.numeric(month)
  ) |>
  distinct(month) |>
  pull(month),
  ~temp |>
  filter(month == .x) |>
  ggplot(
    aes(
      date,
      1
    )
  ) +
  geom_tile(
    aes(
      fill = temp_color
    )
  ) +
  geom_text(
    data = temp |>
    filter(
        str_detect(
          date,
        "-01$"
      )
    ),
    aes(
      label = month_name
    ),
    nudge_y = -.53
  ) +
  coord_flip() +
  facet_wrap(
    ~year,
    scales = "free"
  ) +
  scale_fill_manual(
    values = c(
      "96+" = "#D2042D",
      "89-95" = "#C41E3A",
      "82-88" = "#ED9121",
      "75-81" = "#FFFF99",
      "68-74" = "#FFD700",
      "61-67" = "#7CFC00",
      "54-60" = "#AFDBF5",
      "47-53" = "#008080",
      "40-46" = "#A2C2E0",
      "33-39" = "#0047AB",
      "26-32" = "#D8BFD8",
      "Below 26" = "#800080"
    )
  ) +
  ggmap::theme_nothing()
)
